array.Rechunk.time_rechunk.code:
class Rechunk:
    def time_rechunk(self):
        z = self.small
        for r in self._rechunks(z.shape):
            z = z.rechunk(r)
        z.compute()

    def setup(self):
        small = rnd().random_sample((self.SMALL_N, self.SMALL_N))
        medium = rnd().random_sample((self.MEDIUM_N, self.MEDIUM_N))
        self.small = da.from_array(small, chunks=(small.shape[0], 1))
        self.medium = da.from_array(medium, chunks=(medium.shape[0], 1))

array.FancyIndexing.time_fancy.code:
class FancyIndexing:
    def time_fancy(self):
        self.a[self.c][:, self.s]

    def setup(self):
        r = rnd()
        self.a = da.empty(shape=(2000000, 200, 2), dtype='i1',
                          chunks=(10000, 100, 2))
        self.c = r.randint(0, 2, size=self.a.shape[0], dtype=bool)
        self.s = sorted(r.choice(self.a.shape[1], size=100, replace=False))

io.HDF5.time_read_hdf5.code:
class HDF5:
    def time_read_hdf5(self, get):
        (dd.read_hdf('{}/*.hdf5'.format(self.data_dir), 'key')
           .compute(get=get))

    def setup(self, get):
        if get is dask.multiprocessing.get:
            raise NotImplementedError()

    def setup_cache(self):
        df = mkdf()
        if not os.path.exists(self.data_dir):
            os.mkdir(self.data_dir)

        for i in range(self.n_files):
            df.index += i * len(df)  # for unique index
            df.to_hdf('{}/{}.hdf5'.format(self.data_dir, i), 'key',
                      format='table')

dataframe.MemoryDataFrame.time_set_index.code:
class MemoryDataFrame:
    def time_set_index(self):
        self.smaller_data.set_index('a').compute()

    def setup(self):
        r = rnd()
        df = pd.DataFrame(r.randn(self.N, 2), columns=list('ab'))
        df['c'] = r.randint(0, 500, size=(self.N,))
        self.data = dd.from_pandas(df, npartitions=5)
        self.smaller_data = dd.from_pandas(df[:self.N // 10],
                                           npartitions=5)

